import React, { Component } from 'react';
import axios from 'axios';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import {Redirect,withRouter} from 'react-router-dom';
import { NavLink } from "react-router-dom";

export default class NavBar extends Component {
    
render() {
        return(
            <nav className="mb-4 navbar navbar-expand-lg bg-dark navbar-dark" role="navigation">
                <div className="container">
                    <a className="navbar-brand font-bold" href="#">CloudDrive</a>
                    <button className="navbar-toggler border-0" type="button" data-toggle="collapse" aria-expanded="false" aria-label="Toggle navigation" aria-controls="navbarSupportedContent" data-target="#navbarSupportedContent">
                        &#9776;
                    </button>
                    <div className="collapse navbar-collapse justify-content-end" id="navbarSupportedContent">
                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item"><NavLink to="/About" activeStyle={{color:"white"}} className="nav-link">About</NavLink></li>
                            <li className="nav-item"><NavLink to="/Link" activeStyle={{color:"white"}} className="nav-link">Link</NavLink></li>
                            <li className="nav-item"><NavLink to="/Service" activeStyle={{color:"white"}} className="nav-link">Service</NavLink></li>
                            <li className="nav-item"><NavLink to="/More" activeStyle={{color:"white"}} className="nav-link">More</NavLink></li>
                        </ul>
                        <ul className="nav navbar-nav navbar-right flex-row justify-content-between ml-auto">
                        <button type="button" className="btn btn-primary border-0" style={{border:0, borderRadius:"0px", backgroundColor:"transparent"}} title="Login"><i className="fal fa-sign-in fa-fw fa-lg"></i></button>
                            <ul className="dropdown-menu dropdown-menu-right mt-2">
                                <li className="px-3 py-2">
                                    <form className="form">
                                    <div className="form-group">
                                        <button className="btn btn-primary btn-block" type="button"><i className="fal fa-power-off"></i></button>
                                    </div>
                                    </form>
                                </li>
                            </ul>
                        </ul>
                    </div>
                </div>
            </nav>
        );
    }
}
